import React, { useState, useEffect } from 'react';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { useNavigate, useParams } from "react-router-dom";
import { useAppDispatch, useAppSelector } from '../redux/store';
import { getDetailUsers, getPosts, updateUsers } from '../redux/actions';

const ViewUser = () => {
  const [state, setState] = useState({
    name: "",
    email: "",
    gender: "",
    status: ""
  });

  const [error, setError] = useState("");
  let { id } = useParams();
  const { user } = useAppSelector((state) => state.data);
  let dispatch = useAppDispatch();
  let navigate = useNavigate();
  const { name, email, gender, status } = state;

  useEffect(() => {
    dispatch(getDetailUsers(id));
    // dispatch(getPosts(id));
  }, []);

  useEffect(() => {
    if (user) {
        setState({ ...user });
    }
  }, [user]);

//   const handleInputChange = (e) => {
//     let { name, value } = e.target;
//     setState({ ...state, [name]: value });
//   };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!name || !email || !gender || !status) {
      setError("Please input all Field");
    } else {
      dispatch(updateUsers(state, id));
      navigate("/");
      setError("");
    }
  };

  const StyledTableCell = styled(TableCell)(({ theme }) => ({
        [`&.${tableCellClasses.head}`]: {
        backgroundColor: theme.palette.common.black,
        color: theme.palette.common.white,
        },
        [`&.${tableCellClasses.body}`]: {
        fontSize: 14,
        },
    }));

  const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
      border: 0,
    },
  }));

  const CustomBackButton = styled(Button) ({
        float: 'right',
        marginTop: '-50px',
        marginRight: '30px',
        width: '15%',
        backgroundColor: 'red',
        fontWeight: 'bold',
        '&:hover': {
            backgroundColor: 'black',
            borderColor: 'black',
            boxShadow: 'none',
        }
    });
  return (
    <div>
      <h2 style={{ marginRight: '82%' }}>View User Detail</h2>
      <CustomBackButton variant="contained" onClick={() => navigate('/')}>Back</CustomBackButton>
      <hr></hr>
      {error && <h3 style={{ color: "red" }}>{error}</h3>}
      <Box
        component="form"
        sx={{
          marginRight: 120,
          marginTop: 3,
          '& .MuiTextField-root': { m: 1, width: '25ch' },
        }}
        noValidate
        autoComplete="off"
        onSubmit={handleSubmit}
      >
        <TextField id="filled-read-only-input" label="ID" variant="filled" value={id || ""} name="id" type="text" InputProps={{readOnly: true}}/>
        <br />
        <TextField id="filled-read-only-input" label="Name" variant="filled" value={name || ""} name="name" type="text" InputProps={{readOnly: true}}/>
        <br />
        <TextField id="filled-read-only-input" label="Email" variant="filled" value={email || ""} name="email" type="email" InputProps={{readOnly: true}}/>
        <br />
        <TextField id="filled-read-only-input" label="Gender" variant="filled" value={gender || ""} name="gender" type="text" InputProps={{readOnly: true}}/>
        <br />
        <TextField id="filled-read-only-input" label="Status" variant="filled" value={status || ""} name="status" type="text" InputProps={{readOnly: true}}/>
        <br />
        {/* <ButtonGroup variant="contained" aria-label="text button group">
          <Button style={{ width: '170px' }} color="primary" onClick={() => navigate('/')}>Cancel</Button>
          <Button style={{ marginLeft: '20px', width: '170px' }} color="primary" type="submit">Update</Button>
        </ButtonGroup> */}
      </Box>
      <br />
      <br />
      <div>
        <h2 style={{ marginRight: '85%' }}>Posts List</h2>
      </div>
      <TableContainer component={Paper}>
        <Table sx={{ marginTop: 1, minWidth: 900 }} aria-label="customized table">
            <TableHead>
            <TableRow>
                <StyledTableCell style={{ fontWeight: 'bold' }} align="left">Title</StyledTableCell>
                <StyledTableCell style={{ fontWeight: 'bold' }} align="left">Body</StyledTableCell>
            </TableRow>
            </TableHead>
            <TableBody>
            {/* {users && users.map((user) => ( */}
                <StyledTableRow key={id}>
                <StyledTableCell component="th" scope="row">{id}</StyledTableCell>
                <StyledTableCell align="left">{name}</StyledTableCell>
                </StyledTableRow>
            {/* ))} */}
            </TableBody>
        </Table>
      </TableContainer>
    </div>
  )
}

export default ViewUser;
